executeMail = function() { // Sends the trail
  var arr, littera, s, x, y;
  littera = controls[currentControl][2];
  arr = (function() {
    var j, len, results;
    results = [];
    for (j = 0, len = trail.length; j < len; j++) {
      [x, y] = trail[j];
      results.push(`[${x},${y}]`);
    }
    return results;
  })();
  s = arr.join(",\n");
  return sendMail(`${FILENAME} ${currentControl} ${littera}`, s);
};

